/// Ï Î Ç È Ö È Î Í È Ð Î Â À Í È Å ///

void position(int i, int y) {
    HANDLE hCon;
    COORD cPos;
    hCon = GetStdHandle(STD_OUTPUT_HANDLE);
    cPos.Y = 5 + y;                         //    Y    
    cPos.X = 5 + 12 * i;                    //        
    SetConsoleCursorPosition(hCon, cPos);   // -   
}

