void SetColor(int text, int bg) {
    HANDLE hStdOut = GetStdHandle(STD_OUTPUT_HANDLE);
    SetConsoleTextAttribute(hStdOut, (WORD)((bg << 4) | text));
}

void Green_ON() {
    SetColor(2, 0);
}

void Dark_Gray(){
    SetColor(8, 0);
}

void Black(){
    SetColor(0, 0);
}

void Color_OFF() {
    SetColor(7, 0);
}

